import Todo from './Todo';

const Removed = ({ todos, setTodos, filteredTodos }) => {    
  let list =  filteredTodos.map((todo) => {
    if(todo.id !== todos.id){
      // alert(todo.id);
      return  <Todo
      key={todo.id}
      text={todo.text}
      setTodos={setTodos}
      todos={todos}
      todo={todo}
    />
    }
  }
  );
          return (
            <div className="todo-container">
            <ul className="todo-list">
              {list}
              {/* {filteredTodos.map((todo) => (
                <Todo
                  key={todo.id}
                  text={todo.text}
                  setTodos={setTodos}
                  todos={todos}
                  todo={todo}
                />
              ))} */}
            </ul>
          </div>
          );
          }

export default Removed;
